/thead>\r\n<tbody>\r\n<tr>\r\n<td>Erica Romaguera</td>\r\n<td>Engineer</td>\r\n<td>Audi</td>\r\n<td>New York City</td>\r\n</tr>\r\n<tr>\r\n<td>Caleigh Jerde</td>\r\n<td>Lawyer</td>\r\n<td>Pizza Hut</td>\r\n<td>Los Angeles</td>\r\n</tr>\r\n<tr>\r\n<td>Lucas Schultz</td>\r\n<td>Librarian</td>\r\n<td>Burberry</td>\r\n<td>Beijing</td>\r\n</tr>\r\n<tr>\r\n<td>Carole Marvin</td>\r\n<td>Educator</td>\r\n<td>Starbucks</td>\r\n<td>Istanbul</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Հայերեն</h2>\r\nLorem Ipsum-ը տպագրության և տպագրական արդյունաբերության համար նախատեսված մոդելային տեքստ է: Սկսած 1500-ականներից` Lorem Ipsum-ը հանդիսացել է տպագրական արդյունաբերության ստանդարտ մոդելային տեքստ, ինչը մի անհայտ տպագրիչի կողմից տարբեր տառատեսակների օրինակների գիրք ստեղծելու ջանքերի արդյունք է: Այս տեքստը ոչ միայն կարողացել է գոյատևել հինգ դարաշրջան, այլև ներառվել է էլեկտրոնային տպագրության մեջ` մնալով էապես անփոփոխ: Այն հայտնի է դարձել 1960-ականներին Lorem Ipsum բովանդակող Letraset էջերի թողարկման արդյունքում, իսկ ավելի ուշ համակարգչային տպագրության այնպիսի ծրագրերի թողարկման հետևանքով, ինչպիսին է Aldus PageMaker-ը, որը ներառում է Lorem Ipsum-ի տարատեսակներ:\r\n<h2>Български</h2>\r\nLorem Ipsum е елементарен примерен текст, използван в печатарската и типографската индустрия. Lorem Ipsum е индустриален стандарт от около 1500 година, когато неизвестен печатар взема няколко печатарски букви и ги разбърква, за да напечата с тях книга с примерни шрифтове. Този начин не само е оцелял повече от 5 века, но е навлязъл и в публикуването на електронни издания като е запазен почти без промяна. Популяризиран е през 60те години на 20ти век със издаването на Letraset листи, съдържащи Lorem Ipsum пасажи, популярен е и в наши дни във софтуер за печатни издания като Aldus PageMaker, който включва различни версии на Lorem Ipsum.\r\n<h2>Català</h2>\r\nLorem Ipsum és un text de farciment usat per la indústria de la tipografia i la impremta. Lorem Ipsum ha estat el text estàndard de la indústria des de l’any 1500, quan un impressor desconegut va fer servir una galerada de text i la va mesclar per crear un llibre de mostres tipogràfiques. No només ha sobreviscut cinc segles, sinó que ha fet el salt cap a la creació de tipus de lletra electrònics, romanent essencialment sense canvis. Es va popularitzar l’any 1960 amb el llançament de fulls Letraset que contenien passatges de Lorem Ipsum, i més recentment amb programari d’autoedició com Aldus Pagemaker que inclou versions de Lorem Ipsum.\r\n<h2>Hrvatski</h2>\r\nLorem Ipsum je jednostavno probni tekst koji se koristi u tiskarskoj i slovoslagarskoj industriji. Lorem Ipsum postoji kao industrijski standard još od 16-og stoljeća, kada je nepoznati tiskar uzeo tiskarsku galiju slova i posložio ih da bi napravio knjigu s uzorkom tiska. Taj je tekst ne samo preživio pet stoljeća, već se i vinuo u svijet elektronskog slovoslagarstva, ostajući u suštini nepromijenjen. Postao je popularan tijekom 1960-ih s pojavom Letraset listova s odlomcima Lorem Ipsum-a, a u skorije vrijeme sa software-om za stolno izdavaštvo kao što je Aldus PageMaker koji također sadrži varijante Lorem Ipsum-a.\r\n<h2>Česky</h2>\r\nLorem Ipsum je demonstrativní výplňový text používaný v tiskařském a knihařském průmyslu. Lorem Ipsum je považováno za standard v této oblasti už od začátku 16. století, kdy dnes neznámý tiskař vzal kusy textu a na jejich základě vytvořil speciální vzorovou knihu. Jeho odkaz nevydržel pouze pět století, on přežil i nástup elektronické sazby v podstatě beze změny. Nejvíce popularizováno bylo Lorem Ipsum v šedesátých letech 20. století, kdy byly vydávány speciální vzorníky s jeho pasážemi a později pak díky počítačovým DTP programům jako Aldus PageMaker.\r\n<h2>Româna</h2>\r\nLorem Ipsum este pur şi simplu o machetă pentru text a industriei tipografice. Lorem Ipsum a fost macheta standard a industriei încă din secolul al XVI-lea, când un tipograf anonim a luat o planşetă de litere şi le-a amestecat pentru a crea o carte demonstrativă pentru literele respective. Nu doar că a supravieţuit timp de cinci secole, dar şi a facut saltul în tipografia electronică practic neschimbată. A fost popularizată în anii ’60 odată cu ieşirea colilor Letraset care conţineau pasaje Lorem Ipsum, iar mai recent, prin programele de publicare pentru calculator, ca Aldus PageMaker care includeau versiuni de Lorem Ipsum.\r\n<h2>Српски</h2>\r\nLorem Ipsum је једноставно модел текста који се користи у штампарској и словослагачкој индустрији. Lorem ipsum је био стандард за модел текста још од 1500. године, када је непознати штампар узео кутију са словима и сложио их како би направио узорак књиге. Не само што је овај модел опстао пет векова, него је чак почео да се користи и у електронским медијима, непроменивши се. Популаризован је шездесетих година двадесетог века заједно са листовима летерсета који су садржали Lorem Ipsum пасусе, а данас са софтверским пакетом за прелом као што је Aldus PageMaker који је садржао Lorem Ipsum верзије.\r\n\r\n&nbsp;', 'Full Width', '', 'publish', 'closed', 'closed', '', 'full-width', '', '', '2018-05-25 08:54:07', '2018-05-25 08:54:07', '', 0, 'http://demo.rarathemes.com/perfect-portfolio/?page_id=497', 0, 'page', '', 0),
(502, 1, '2018-05-25 09:04:35', '2018-05-25 09:04:35', 'The style guide provides you with a blueprint of Paperback’s default post and page styles. The style guide is also a great reference for suggested typographic treatment and styles for your content.\r\n\r\n<hr />\r\n\r\n<h4>Right Aligned Image</h4>\r\n<img class=\"size-medium wp-image-68 alignright\" src=\"http://demo.rarathemes.com/perfect-portfolio/wp-content/uploads/sites/56/2018/05/skyscraper-2756497_1920-1-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" />Images may be two-dimensional, such as a photograph, screen display, and as well as a three-dimensional, such as a statue or hologram. They may be captured by optical devices – such as cameras, mirrors, lenses, telescopes, microscopes, etc. and natural objects and phenomena, such as the human eye or water surfaces. The word image is also used in the broader sense of any two-dimensional figure such as a map, a graph, a pie chart, or an abstract painting. The word image is also used in the broader sense of any two-dimensional figure such as a map, a graph, a pie chart, or an abstract painting. The word image is also used in the broader sense of any two-dimensional figure such as a map, a graph, a pie chart, or an abstract painting.\r\n\r\n<hr />\r\n\r\n<h4>Left Aligned Image</h4>\r\n<img class=\"size-medium wp-image-85 alignleft\" src=\"http://demo.rarathemes.com/perfect-portfolio/wp-content/uploads/sites/56/2018/05/art-3416661_1920-1-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" />The word image is also used in the broader sense of any two-dimensional figure such as a map, a graph, a pie chart, or an abstract painting. In this wider sense, images can also be rendered manually, such as by drawing, painting, carving, rendered automatically by printing or computer graphics technology, or developed by a combination of methods. Images may be two-dimensional, such as a photograph, screen display, and as well as a three-dimensional, such as a statue or hologram.\r\n\r\nA volatile image is one that exists only for a short period of time. This may be a reflection of an object by a mirror, a projection of a camera obscura, or a scene displayed on a cathode ray tube. A fixed image, also called a hard copy.\r\n\r\n<hr />\r\n\r\n<div class=\"tiled-gallery type-rectangular\">\r\n<div class=\"gallery-row\">\r\n<div class=\"gallery-group images-1\">\r\n<div id=\"gallery-1\" class=\"gallery galleryid-265 gallery-columns-2 gallery-size-full\">\r\n<figure class=\"gallery-item\">\r\n<div class=\"gallery-icon landscape\"></div></figure>\r\n</div>\r\n</div>\r\n<div class=\"gallery-group images-3\"></div>\r\n</div>\r\n</div>\r\n<h1>Heading One</h1>\r\n<h2>Heading Two</h2>\r\n<h3>Heading Three</h3>\r\n<h4>Heading Four</h4>\r\n<h5>Heading Five</h5>\r\n<h6>Heading Six</h6>\r\n<h6></h6>\r\n\r\n<hr />\r\n\r\n<h3>Blockquote</h3>\r\n<blockquote>The greatest gift of life is friendship, and I have received it.</blockquote>\r\n<h3 id=\"pull-quotes\">Typography Styles</h3>\r\n<span id=\"dropcap\" class=\"dropcap\">A</span>drop cap is a decorative element typically used in documents at the start of a section or chapter. It’s a large capital letter at the beginning or a paragraph or text block that has the depth of two or more lines of normal text. You can easily add a dropcap to any paragraph by adding the class <strong>dropcap</strong> as seen below:\r\n<pre>&lt;span class=\"dropcap\"&gt;T&lt;/span&gt;his is how you add a dropcap.</pre>\r\n\r\n<hr />\r\n\r\n<h3>Table Styles</h3>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>BEATLE</th>\r\n<th>INSTRUMENT</th>\r\n<th>SONG</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr class=\"odd\">\r\n<td>John Lennon</td>\r\n<td>Guitar</td>\r\n<td>A Day In the Life</td>\r\n</tr>\r\n<tr class=\"even\">\r\n<td>George Harrison</td>\r\n<td>Guitar</td>\r\n<td>Old Brown Shoe</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td>Paul McCartney</td>\r\n<td>Bass</td>\r\n<td>Helter Skelter</td>\r\n</tr>\r\n<tr class=\"even\">\r\n<td>Ringo St