(589, 1, '2019-11-13 16:23:49', '0000-00-00 00:00:00', '<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p><em>In A World Where We Can Be Anything Let Us Sit For A While, Think Of A Problem Which Either We Or Our Surroundings Are Facing And Then Brainstorm, Discuss, And Solve…</em></p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:heading -->\n<h2></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>Mohammed Shaheer Ahmed,</strong>&nbsp;known as Shaheer Ahmed(in&nbsp;<a href=\"https://en.gyaanipedia.co.in/wiki/Hindi\">Hindi</a>&nbsp;शहीर अहमद and in&nbsp;<a href=\"https://en.gyaanipedia.co.in/wiki/Urdu_Gyaanipedia\">Urdu</a>&nbsp;شہیر احمد) is an&nbsp;<a href=\"https://en.gyaanipedia.co.in/wiki/Indian\">Indian</a>&nbsp;Blogger, author, poet and the founder of&nbsp;<a href=\"https://www.unveilindia.online/\">Unveil India</a>&nbsp;( born on 23 December 2003 ) in Jangaon, former Warangal Dist. which is the present Jangaon Dist. in&nbsp;<a href=\"https://en.gyaanipedia.co.in/wiki/Telangana\">Telangana</a>&nbsp;state. He is popularly known for his book \"<a href=\"https://www.amazon.com/Illegal-but-still-legal-Misadventures-ebook/dp/B07TTZFH9Q\">Illegal But Still Legal: Misadventures of Nation-State Actors</a>\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table -->\n<table class=\"wp-block-table\"><tbody><tr><th>Mohammed Shaheer Ahmed</th></tr><tr><td>शहीर अहमद</td></tr><tr><td><a href=\"https://en.gyaanipedia.co.in/wiki/File:Boring_Curiosity.jpg\"></a>Shaheer Ahmed on 08 July 2019<br></td></tr><tr><td></td></tr><tr><th>Founder of&nbsp;<a href=\"https://www.unveilindia.online/\">Unveil India</a></th></tr><tr><td><strong>present</strong></td></tr><tr><td><strong>Assumed office</strong>06 october 2019 - (present)</td></tr><tr><th>Owner of <a href=\"https://www.youtube.com/channel/UCLyBFHpePruiS_VFzoTltYw\">Aspect Modifier Productions</a></th></tr><tr><td><strong>On YouTube</strong>31 March 2019</td></tr><tr><th>Managed by</th><td>Team Aspect Modifier</td></tr><tr><th>Personal details</th></tr><tr><th>Born</th><td>08 July 2003<a href=\"https://en.gyaanipedia.co.in/wiki/Telangana\">Telangana</a>,&nbsp;<a href=\"https://en.gyaanipedia.co.in/wiki/India\">India</a></td></tr><tr><th>Nationality</th><td><a href=\"https://en.gyaanipedia.co.in/wiki/Indian\">Indian</a></td></tr><tr><th>Mother</th><td>Rehana Yasmeen</td></tr><tr><th>Father</th><td>Mohammed Ameer Ahmed</td></tr><tr><th>Relatives</th><td>Mohammed Sameer Ahmed (brother)</td></tr><tr><th>Residence</th><td>Jangaon</td></tr><tr><th>Education</th><td>Sri Aurobindo High School, Jangaon (2005-2018)</td></tr><tr><th><a href=\"https://en.gyaanipedia.co.in/wiki/Alma_mater\">Alma mater</a></th><td>ABV Junior College (2019- present)</td></tr><tr><th>Occupation</th><td>Student</td></tr><tr><th>Known for</th><td>Blogging and Writings</td></tr></tbody></table>\n<!-- /wp:table -->\n\n<!-- wp:heading -->\n<h2>Early Life</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Shaheer was good at studies since his early age. His Father, Mohammed Ameer Ahmed and Mother, Rehana Yasmeen always supported him in all his activities which helped him reach his goals. In any circumstance they never discouraged him.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Books</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.amazon.com/Illegal-but-still-legal-Misadventures-ebook/dp/B07TTZFH9Q\">Illegal But Still Legal: Misadventures of Nation-State Actors</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Out Coming Talent</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image\"><a href=\"https://en.gyaanipedia.co.in/wiki/File:Passionate_Shaheer_Ahmed.jpg\"><img src=\"https://static.miraheze.org/gyaanipediawiki/thumb/8/89/Passionate_Shaheer_Ahmed.jpg/300px-Passionate_Shaheer_Ahmed.jpg\" alt=\"Follow your passion - Shaheer Ahmed\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Follow your passion</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>Shaheer was born in a small town Jangaon, which is now a district. Until 2017 he had no internet facilities, when he knew about internet he became more and more curious about it and went deep in it. This resulted in the combination of his passion of writing, therefore he written an ebook and published it on 7th July 2019.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Who Am I?', '', 'draft', 'open', 'open', '', '', '', '', '2019-11-13 16:23:49', '2019-11-13 16:23:49', '', 0, 'http://shaheerahmed.rf.gd/?p=589', 0, 'post', '', 0),
