your passion</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>Shaheer was born in a small town Jangaon, which is now a district. Until 2017 he had no internet facilities, when he knew about internet he became more and more curious about it and went deep in it. This resulted in the combination of his passion of writing, therefore he written an ebook and published it on 7th July 2019.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Who Am I?', '', 'inherit', 'closed', 'closed', '', '589-revision-v1', '', '', '2019-11-13 16:23:42', '2019-11-13 16:23:42', '', 589, 'http://shaheerahmed.rf.gd/2019/11/13/589-revision-v1/', 0, 'revision', '', 0),
(591, 1, '2019-11-13 17:11:08', '2019-11-13 17:11:08', '<blockquote class=\"wp-block-quote\"><em>In A World Where We Can Be Anything Let Us Sit For A While, Think Of A Problem Which Either We Or Our Surroundings Are Facing And Then Brainstorm, Discuss, And Solve…</em></blockquote>\r\n<h2></h2>\r\n<strong>Mohammed Shaheer Ahmed,</strong> known as Shaheer Ahmed(in <a href=\"https://en.gyaanipedia.co.in/wiki/Hindi\">Hindi</a> शहीर अहमद and in <a href=\"https://en.gyaanipedia.co.in/wiki/Urdu_Gyaanipedia\">Urdu</a> شہیر احمد) is an <a href=\"https://en.gyaanipedia.co.in/wiki/Indian\">Indian</a> Blogger, author, poet and the founder of <a href=\"https://www.unveilindia.online/\">Unveil India</a> ( born on 23 December 2003 ) in Jangaon, former Warangal Dist. which is the present Jangaon Dist. in <a href=\"https://en.gyaanipedia.co.in/wiki/Telangana\">Telangana</a> state. He is popularly known for his ebooks “<a href=\"https://www.amazon.com/Illegal-but-still-legal-Misadventures-ebook/dp/B07TTZFH9Q\">Illegal But Still Legal: Misadventures of Nation-State Actors</a>“ and \"<a href=\"https://www.amazon.in/Ruling-Cyberspace-administration-command-Internet-ebook/dp/B07ZMFHY7X/ref=sr_1_2?keywords=shaheer+ahmed&amp;qid=1573065227&amp;sr=8-2\">Ruling the Cyberspace</a>\".\r\n<table class=\"wp-block-table\">\r\n<tbody>\r\n<tr>\r\n<th>MOHAMMED SHAHEER AHMED</th>\r\n</tr>\r\n<tr>\r\n<td>शहीर अहमद</td>\r\n</tr>\r\n<tr>\r\n<td>Shaheer Ahmed on 08 July 2019</td>\r\n</tr>\r\n<tr>\r\n<td></td>\r\n</tr>\r\n<tr>\r\n<th>FOUNDER OF <a href=\"https://www.unveilindia.online/\">UNVEIL INDIA</a></th>\r\n</tr>\r\n<tr>\r\n<td><strong>present</strong></td>\r\n</tr>\r\n<tr>\r\n<td>06 October 2019 – (present)</td>\r\n</tr>\r\n<tr>\r\n<th>OWNER OF <a href=\"https://www.youtube.com/channel/UCLyBFHpePruiS_VFzoTltYw\">ASPECT MODIFIER PRODUCTIONS</a></th>\r\n</tr>\r\n<tr>\r\n<td><strong>On YouTube</strong>31 March 2019</td>\r\n</tr>\r\n<tr>\r\n<th>MANAGED BY</th>\r\n<td>Team Aspect Modifier</td>\r\n</tr>\r