haheer Ahmed\" data-src=\"https://static.miraheze.org/gyaanipediawiki/thumb/8/89/Passionate_Shaheer_Ahmed.jpg/300px-Passionate_Shaheer_Ahmed.jpg\" /></a></figure>\r\nFollow your passion\r\n\r\nShaheer was born in a small town Jangaon, which is now a district. Until 2017 he had no internet facilities, when he knew about the internet he became more and more curious about it and went deep in it. This resulted in the combination of his passion for writing, therefore he wrote an ebook and published it on 7th July 2019.', 'Who is Shaheer Ahmed?', '', 'publish', 'open', 'open', '', 'about-me', '', '', '2019-11-13 17:15:23', '2019-11-13 17:15:23', '', 0, 'http://shaheerahmed.rf.gd/?p=591', 0, 'post', '', 0),
