(593, 1, '2019-11-13 17:11:40', '2019-11-13 17:11:40', '<blockquote class=\"wp-block-quote\"><em>In A World Where We Can Be Anything Let Us Sit For A While, Think Of A Problem Which Either We Or Our Surroundings Are Facing And Then Brainstorm, Discuss, And Solve…</em></blockquote>\r\n<h2></h2>\r\n<strong>Mohammed Shaheer Ahmed,</strong> known as Shaheer Ahmed(in <a href=\"https://en.gyaanipedia.co.in/wiki/Hindi\">Hindi</a> शहीर अहमद and in <a href=\"https://en.gyaanipedia.co.in/wiki/Urdu_Gyaanipedia\">Urdu</a> شہیر احمد) is an <a href=\"https://en.gyaanipedia.co.in/wiki/Indian\">Indian</a> Blogger, author, poet and the founder of <a href=\"https://www.unveilindia.online/\">Unveil India</a> ( born on 23 December 2003 ) in Jangaon, former Warangal Dist. which is the present Jangaon Dist. in <a href=\"https://en.gyaanipedia.co.in/wiki/Telangana\">Telangana</a> state. He is popularly known for his book “<a href=\"https://www.amazon.com/Illegal-but-still-legal-Misadventures-ebook/dp/B07TTZFH9Q\">Illegal But Still Legal: Misadventures of Nation-State Actors</a>“.\r\n<table class=\"wp-block-table\">\r\n<tbody>\r\n<tr>\r\n<th>MOHAMMED SHAHEER AHMED</th>\r\n</tr>\r\n<tr>\r\n<td>शहीर अहमद</td>\r\n</tr>\r\n<tr>\r\n<td>Shaheer Ahmed on 08 July 2019</td>\r\n</tr>\r\n<tr>\r\n<td></td>\r\n</tr>\r\n<tr>\r\n<th>FOUNDER OF <a href=\"https://www.unveilindia.online/\">UNVEIL INDIA</a></th>\r\n</tr>\r\n<tr>\r\n<td><strong>present</strong></td>\r\n</tr>\r\n<tr>\r\n<td>06 October 2019 – (present)</td>\r\n</tr>\r\n<tr>\r\n<th>OWNER OF <a href=\"https://www.youtube.com/channel/UCLyBFHpePruiS_VFzoTltYw\">ASPECT MODIFIER PRODUCTIONS</a></th>\r\n</tr>\r\n<tr>\r\n<td><strong>On YouTube</strong>31 March 2019</td>\r\n</tr>\r\n<tr>\r\n<th>MANAGED BY</th>\r\n<td>Team Aspect Modifier</td>\r\n</tr>\r\n<tr>\r\n<th>PERSONAL DETAILS</th>\r\n</tr>\r\n<tr>\r\n<th>BORN</th>\r\n<td>08 July 2003<a href=\"https://en.gyaanipedia.co.in/wiki/Telangana\">Telangana</a>, <a href=\"https://en.gyaanipedia.co.in/wiki/India\">India</a></td>\r\n</tr>\r\n<tr>\r\n<th>NATIONALITY</th>\r\n<td><a href=\"https://en.gyaanipedia.co.in/wiki/Indian\">Indian</a></td>\r\n</tr>\r\n<tr>\r\n<th>MOTHER</th>\r\n<td>Rehana Yasmeen</td>\r\n</tr>\r\n<tr>\r\n<th>FATHER</th>\r\n<td>Mohammed Ameer Ahmed</td>\r\n</tr>\r\n<tr>\r\n<th>RELATIVES</th>\r\n<td>Mohammed Sameer Ahmed (brother)</td>\r\n</tr>\r\n<tr>\r\n<th>RESIDENCE</th>\r\n<td>Jangaon</td>\r\n</tr>\r\n<tr>\r\n<th>EDUCATION</th>\r\n<td>Sri Aurobindo High School, Jangaon (2005-2018)</td>\r\n</tr>\r\n<tr>\r\n<th><a href=\"https://en.gyaanipedia.co.in/wiki/Alma_mater\">ALMA MATER</a></th>\r\n<td>ABV Junior College (2019- present)</td>\r\n</tr>\r\n<tr>\r\n<th>OCCUPATION</th>\r\n<td>Student</td>\r\n</tr>\r\n<tr>\r\n<th>KNOWN FOR</th>\r\n<td>Blogging and Writings</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Early Life</h2>\r\nShaheer was good at studies from an early age. His father, Mohammed Ameer Ahmed, and Mother, Rehana Yasmeen always supported him in all his activities which helped him reach his goals. In any circumstance, they never discouraged him.\r\n<h2>Books</h2>\r\n<a href=\"https://www.amazon.com/Illegal-but-still-legal-Misadventures-ebook/dp/B07TTZFH9Q\">Illegal But Still Legal: Misadventures of Nation-State Actors</a>\r\n<h2>Out Coming Talent</h2>\r\n<figure class=\"wp-block-image\"><a href=\"https://en.gyaanipedia.co.in/wiki/File:Passionate_Shaheer_Ahmed.jpg\"><img class=\" lazyloaded\" src=\"https://static.miraheze.org/gyaanipediawiki/thumb/8/89/Passionate_Shaheer_Ahmed.jpg/300px-Passionate_Shaheer_Ahmed.jpg\" alt=\"Follow your passion - Shaheer Ahmed\" data-src=\"https://static.miraheze.org/gyaanipediawiki/thumb/8/89/Passionate_Shaheer_Ahmed.jpg/300px-Passionate_Shaheer_Ahmed.jpg\" /></a></figure>\r\nFollow your passion\r\n\r\nShaheer was born in a small town Jangaon, which is now a district. Until 2017 he had no internet facilities, when he knew about the internet he became more and more curious about it and went deep in it. This resulted in the combination of his passion for writing, therefore he wrote an ebook and published it on 7th July 2019.', 'Who is Shaheer Ahmed?', '', 'inherit', 'closed', 'closed', '', '591-revision-v1', '', '', '2019-11-13 17:11:40', '2019-11-13 17:11:40', '', 591, 'http://shaheerahmed.rf.gd/2019/11/13/591-revision-v1/', 0, 'revision', '', 0),
