n.gyaanipedia.co.in/wiki/Indian\">Indian</a></td>\n</tr>\n<tr>\n<th>MOTHER</th>\n<td>Rehana Yasmeen</td>\n</tr>\n<tr>\n<th>FATHER</th>\n<td>Mohammed Ameer Ahmed</td>\n</tr>\n<tr>\n<th>RELATIVES</th>\n<td>Mohammed Sameer Ahmed (brother)</td>\n</tr>\n<tr>\n<th>RESIDENCE</th>\n<td>Jangaon</td>\n</tr>\n<tr>\n<th>EDUCATION</th>\n<td>Sri Aurobindo High School, Jangaon (2005-2018)</td>\n</tr>\n<tr>\n<th><a href=\"https://en.gyaanipedia.co.in/wiki/Alma_mater\">ALMA MATER</a></th>\n<td>ABV Junior College (2019- present)</td>\n</tr>\n<tr>\n<th>OCCUPATION</th>\n<td>Student</td>\n</tr>\n<tr>\n<th>KNOWN FOR</th>\n<td>Blogging and Writings</td>\n</tr>\n</tbody>\n</table>\n<h2>Early Life</h2>\nShaheer was good at studies from an early age. His father, Mohammed Ameer Ahmed, and Mother, Rehana Yasmeen always supported him in all his activities which helped him reach his goals. In any circumstance, they never discouraged him.\n<h2>Books</h2>\n<a href=\"https://www.amazon.com/Illegal-but-still-legal-Misadventures-ebook/dp/B07TTZFH9Q\">Illegal But Still Legal: Misadventures of Nation-State Actors</a>\n\nRuling the Cyberspace\n<h2>Out Coming Talent</h2>\n<figure class=\"wp-block-image\"><a href=\"https://en.gyaanipedia.co.in/wiki/File:Passionate_Shaheer_Ahmed.jpg\"><img class=\" lazyloaded\" src=\"https://static.miraheze.org/gyaanipediawiki/thumb/8/89/Passionate_Shaheer_Ahmed.jpg/300px-Passionate_Shaheer_Ahmed.jpg\" alt=\"Follow your passion - Shaheer Ahmed\" data-src=\"https://static.miraheze.org/gyaanipediawiki/thumb/8/89/Passionate_Shaheer_Ahmed.jpg/300px-Passionate_Shaheer_Ahmed.jpg\" /></a></figure>\nFollow your passion\n\nShaheer was born in a small town Jangaon, which is now a district. Until 2017 he had no internet facilities, when he knew about the internet he became more and more curious about it and went deep in it. This resulted in the combination of his passion for writing, therefore he wrote an ebook and published it on 7th July 2019.', 'Who is Shaheer Ahmed?', '', 'inherit', 'closed', 'closed', '', '591-autosave-v1', '', '', '2019-11-13 17:14:24', '2019-11-13 17:14:24', '', 591, 'http://shaheerahmed.rf.gd/2019/11/13/591-autosave-v1/', 0, 'revision', '', 0),
